import React, {Component} from "react";

import  { useState } from "react";

function LikeBtn() {
  const [likes, setLikes] = useState(0);

  return <button className="bg-yellow-100" onClick={() => setLikes(likes + 1)}>{likes} ❤️</button>;
}

export default LikeBtn;
